import { COLOR } from '../../constant/common';

function Color() {
    return (
        <div>
            <div>
                {
                    COLOR.map((key) => {
                        return (
                            <img className='side-product-display' src={key.img}>
                            </img>
                        )
                    })
                }
            </div>
        </div>
    );
}

export default Color;

function Size() {
    return (
        <div>
            <div>
                {
                    COLOR.map((key) => {
                        return (
                            <img className='side-product-display' src={key.img}>
                            </img>
                        )
                    })
                }
            </div>
        </div>
    );
}

export default Size;
